import React from 'react';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';

import Card from './Card.js';

const style = {
  display: 'flex',
  justifyContent: 'center',
  width: '100%',
  height: '35vh',
  background: '#0009'
}

const defaultData = [null, null, null, null, null, null, null];

const Bar = (props) => {

  const cards = props.selected !== null
    ? ""
    : defaultData.map((value, key) => (
      <Card key={key} data={value} />
    ))

  return (
    <Container style={style}>
      <Box 
        sx={{
          display: 'flex',
          flexWrap: 'wrap',
          '& > :not(style)': {
            m: 1,
            width: 128,
            height: 128,
          },
        }}
      >
        {cards}
      </Box>
    </Container>
  )
}

export default Bar
